/*
    Send data to the connected host
*/
bool TcpClient::send_data(string data)
{
    // Send some data
    if( send(sock , data.c_str() , strlen( data.c_str() ) , 0) < 0)
    {
        perror("Send failed : ");
        return false;
    }

    return true;
}

/*
    Receive data from the connected host
*/
string TcpClient::receive(int size=512)
{
    char buffer[32768];
    string reply;
    size_t ret;

    //Receive a reply from the server
    if((ret = recv(sock , buffer , sizeof(buffer) , 0)) < 0)
    {
        puts("recv failed");
        return NULL;
    }

    buffer[ret] = '\0';
//    std::cout << "buffer: " << buffer << std::endl;
 //   std::cout << "ret: " << ret << std::endl;
    if (ret > 0 && ret < (unsigned long)18446744073709551615)
    {
        //  std::cout << "buffer: " << buffer << std::endl;
        reply = buffer;
        response_data = reply;
    }
    else if (response_data == "")
        response_data = "end";
    memset(buffer, '\0', 32768);
    return reply;
}

int ft_result(int expLen, int retLen, std::string expStatus, std::string retStatus, std::string expBody, std::string retBody, std::string title)
{
    int score = 1;
    std::cout << RESET <<"\n  .-.-.   .-.-.   .-.-.   .-.-.   .-.-.   .-.-.   .-.-.   .-.-\n\
 / / \\ \\ / / \\ \\ / / \\ \\ / / \\ \\ / / \\ \\ / / \\ \\ / / \\ \\ / / \\ \\\n\
`-'   `-`-'   `-`-'   `-`-'   `-`-'   `-`-'   `-`-'   `-`-'\n\n";
    std::cout << BOLDBLACK << title;
    if (strcmp(expStatus.c_str(), retStatus.c_str()) == 0)
        std::cout << BOLDBLACK <<" Status [" << BOLDGREEN << retStatus << BOLDBLACK << "]\n";
    else
    {
      std::cout << BOLDBLACK << " Returned Status [" << BOLDRED << retStatus <<  BOLDBLACK << "]" << " Expected [" <<  BOLDGREEN  << expStatus << BOLDBLACK << "]\n";
      score = 0;
    }
    if (expLen == retLen && expBody != "")
        std::cout << BOLDBLACK <<" Content-Length [" << BOLDGREEN << retLen << BOLDBLACK << "]\n";
    else if (expBody != "")
    {
        std::cout << BOLDBLACK << " Returned Content-Length [" << BOLDRED << retLen << BOLDBLACK << "]" << " Expected [" <<  BOLDGREEN  << expLen << BOLDBLACK << "]\n";
        score = 0;
    }
    if (strcmp(expBody.c_str(), retBody.c_str()) == 0)
        std::cout << BOLDBLACK <<" Body[" << BOLDGREEN << retBody.substr(0, 10) << BOLDBLACK << "...]\n";
    else if (expBody != "")
    {
        std::cout << expBody.size() << " -- " << retBody.size() << std::endl;
        std::cout << BOLDBLACK << " Returned Body[" << BOLDRED << retBody.substr(0, 10) << BOLDBLACK << "...]" << " Expected [" <<  BOLDGREEN  << expBody.substr(0, 10) << BOLDBLACK << "...]\n";
        score = 0;
    }
    return (score);
}

